import React from 'react'
import { useState } from 'react';
import {Navbar, Nav, Container, Modal, Button} from 'react-bootstrap';

const CustomNavbar = () => {
    const [login, setLogin] = useState(false);
    const [register, setRegister] = useState(false);

    const loginClose = () => setLogin(false);
    const registerClose = () => setRegister(false);
    const handleLogin = () => setLogin(true);
    const handleRegister = () => setRegister(true);

  return (
    <>
    <Navbar bg="dark" data-bs-theme="dark">
        <Container>
          <Navbar.Brand href="#home">Rentify</Navbar.Brand>
          <Nav className="me-2">
          <Button className='me-1' variant="secondary" onClick={handleRegister}>
            Register
          </Button>
          <Button className='ms-1' variant="secondary" onClick={handleLogin}>
            Login
          </Button>
          </Nav>
        </Container>
      </Navbar>

      <Modal
        show={login}
        onHide={loginClose}
        backdrop="static"
        keyboard={false}
      >
      <Modal.Header closeButton>
          <Modal.Title>Log in</Modal.Title>
        </Modal.Header>
        <Modal.Body>
          I will not close if you click outside me. Do not even try to press
          escape key.
        </Modal.Body>
        <Modal.Footer>
          <Button variant="secondary" onClick={loginClose}>
            Close
          </Button>
          <Button variant="primary">Log in</Button>
        </Modal.Footer>
      </Modal>
    </>
  )
}

export default CustomNavbar
